SAPO Desporto, um remate certeiro.

Acompanhe em primeira mão toda a atualidade desportiva: notícias, classificações, informações dos clubes e planteis, estatísticas e o calendário desportivo. Além dos principais destaques do dia encontrará:

Informações sobre a Primeira Liga e competições Europeias;
Calendários, classificações, goleadores e galerias de fotos;
Jogos em direto com descrição ao minuto do que se passa em campo;
Vídeos de resumos dos jogos, golos e lances, entrevistas, conferências de imprensa e as últimas reações;
Cartoon humorístico diário;
Notificações dos jogos e das equipas favoritas;
Informações de outras modalidades desportivas;

A aplicação do SAPO Desporto está disponível para iPhone, iPod e iPad.
O SAPO, MEO, MOCHE e ALTICE EMPRESAS são marcas do Grupo Altice.
